    <MemoryRouter initialEntries={['/home']} initialIndex={0}>
      <Route>
        {({ location }) => {
          const query = new URLSearchParams(location.search);
          return (
            <Pagination
              count={2}
              onChange={handleChange} 
            />
          );
        }}
      </Route>
    </MemoryRouter>
  );
}
